import { ECategory } from '@common/enums/category.enum';

export const getCategoryTitle = (category: ECategory): string => {
    switch (category) {
        case ECategory['fruit-and-veg-box']:
            return 'Fruit & Veg Box';
        case ECategory['veg-box']:
            return 'Veg Box';
        case ECategory['fruit-box']:
            return 'Fruit Booster';
    }
    return '';
};
